import React from "react";
import logoImage from './logo.png';
import './App.css';

const customStyle = {
  background: "#669999",
  margin: "auto -16px",
  padding: "16px 32px",
  fontFamily: "Times New Roman",
  fontWeight: "bold",
  boxShadow: "0 0 10px rgba(0, 0, 0, 0.3)",
  display: "flex",
  alignItems: "center",
  justifyContent: "space-between"
};

const headername= {
  fontWeight: "bold",
  marginBottom: "10px",
  textShadow: "2px 2px 2px white",
  // Adding blinking animation
};

const impmsg={
    animation: "runningText 10s linear infinite",
    alignItems:"center",
    textColor:"Yellow",
}

const logoStyle = {
  height: "50px",
  width: "100px"
};

function Header() {
  return (
    <header style={customStyle}>
      <h1 style={headername}>Aptitude Test</h1>
      <p style={impmsg} >Your under our surveilence, So don't try to copy questions or any other malpractices!!!</p>
      <img src={logoImage} alt="Company Logo" style={logoStyle} />
    </header>
  );
}

export default Header;
